INSERT INTO `timlis_news_mission` (`title`, `content`, `id`)
VALUES
	('Миссия / Стратегия','<p><strong>НАША МИССИЯ</strong><span>&nbsp;</span>в том что компания «Тимлис», крупнейший российский системный интегратор, стала платиновым спонсором Dell EMC Forum 2016, который состоится в среду - 9 ноября 2016 года в ЦВК «Экспоцентр» (Москва, Краснопресненская наб., 14, павильон 3).</p>\r\n\r\n<p><strong>НАША СТРАТЕГИЯ</strong><span>&nbsp;</span>— крупнейшее мероприятие для партнеров и заказчиков новой компании Dell EMC, которое объединило ежегодные Форумы решений Dell и EMC Форумы. Мероприятие посвящено основным тенденциям, трансформирующим рынки и бизнес, и будет интересно как представителям бизнес-подразделений организаций, так и профессионалам в области высоких технологий.</p>',1);
